import React from 'react';
import Home from './home'; // Import your Home component

function App() {
  return (
    <div>
      <Home />
    </div>
  );
}

export default App;


<button
  onClick={() => alert('Thanks for visiting my website!')}
  style={{
    padding: '10px 20px',
    fontSize: '16px',
    color: 'white',
    backgroundColor: '#007bff',
    border: 'none',
    borderRadius: '5px',
    cursor: 'pointer',
    marginTop: '20px',
  }}
>
  Click Me!
</button>
